import React, { useState, useEffect } from 'react';
import Header from '../components/Header';
import '../styles/SchedulePage.css';

function SchedulePage() {
  const [visits, setVisits] = useState([]);
  const [newVisit, setNewVisit] = useState({
    caregiverId: '',
    caregiverName: '',
    date: '',
    time: '',
    duration: 60,
    type: 'Regular Visit',
    notes: ''
  });
  const [caregivers, setCaregivers] = useState([]);
  const [viewMode, setViewMode] = useState('calendar'); // 'calendar' or 'list'

  // Mock data loading
  useEffect(() => {
    // Fetch visits
    setVisits([
      { 
        id: '1', 
        caregiverId: '2', 
        caregiverName: 'John Smith', 
        date: '2025-02-27T10:00:00', 
        duration: 60,
        type: 'Regular Visit',
        notes: 'Check on medication compliance'
      },
      { 
        id: '2', 
        caregiverId: '3', 
        caregiverName: 'Susan Lee', 
        date: '2025-03-01T14:00:00', 
        duration: 120,
        type: 'Doctor Appointment',
        notes: 'Cardiology follow-up'
      },
      { 
        id: '3', 
        caregiverId: '4', 
        caregiverName: 'Maria Garcia', 
        date: '2025-03-03T11:00:00', 
        duration: 90,
        type: 'Therapy Session',
        notes: 'Physical therapy for mobility'
      }
    ]);

    // Fetch caregivers
    setCaregivers([
      { id: '2', name: 'John Smith', role: 'Son' },
      { id: '3', name: 'Susan Lee', role: 'Daughter' },
      { id: '4', name: 'Maria Garcia', role: 'Home Nurse' },
      { id: '5', name: 'Robert Johnson', role: 'Grandson' }
    ]);
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewVisit({
      ...newVisit,
      [name]: value
    });
  };

  const handleCaregiverSelect = (e) => {
    const caregiverId = e.target.value;
    const caregiver = caregivers.find(cg => cg.id === caregiverId);

    setNewVisit({
      ...newVisit,
      caregiverId,
      caregiverName: caregiver ? caregiver.name : ''
    });
  };

  const handleAddVisit = (e) => {
    e.preventDefault();

    // Create a new visit object
    const visit = {
      id: Date.now().toString(), // temporary ID for mock data
      ...newVisit,
      date: `${newVisit.date}T${newVisit.time}:00`
    };

    // Add to the visits array
    setVisits([...visits, visit]);

    // Reset form
    setNewVisit({
      caregiverId: '',
      caregiverName: '',
      date: '',
      time: '',
      duration: 60,
      type: 'Regular Visit',
      notes: ''
    });
  };

  const renderCalendarView = () => {
    // This would be a calendar component in a real app
    return (
      <div className="calendar-view">
        <p>Calendar view would go here</p>
        <div className="calendar-grid">
          {/* Calendar grid would be rendered here */}
          <div className="calendar-placeholder">
            Calendar component would be integrated here
          </div>
        </div>
      </div>
    );
  };

  const renderListView = () => {
    return (
      <div className="list-view">
        <table className="visit-table">
          <thead>
            <tr>
              <th>Date & Time</th>
              <th>Duration</th>
              <th>Caregiver</th>
              <th>Type</th>
              <th>Notes</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {visits.sort((a, b) => new Date(a.date) - new Date(b.date)).map(visit => (
              <tr key={visit.id}>
                <td>{new Date(visit.date).toLocaleString()}</td>
                <td>{visit.duration} minutes</td>
                <td>{visit.caregiverName}</td>
                <td>{visit.type}</td>
                <td>{visit.notes}</td>
                <td>
                  <button className="edit-btn">Edit</button>
                  <button className="delete-btn">Cancel</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="schedule-page">
      <Header user={{ name: 'Jane Doe' }} onLogout={() => console.log('logout')} />

      <main>
        <h2>Visit Schedule</h2>

        <div className="view-controls">
          <button 
            className={viewMode === 'calendar' ? 'active' : ''} 
            onClick={() => setViewMode('calendar')}
          >
            Calendar View
          </button>
          <button 
            className={viewMode === 'list' ? 'active' : ''} 
            onClick={() => setViewMode('list')}
          >
            List View
          </button>
        </div>

        {viewMode === 'calendar' ? renderCalendarView() : renderListView()}

        <div className="add-visit-section">
          <h3>Schedule a New Visit</h3>
          <form onSubmit={handleAddVisit}>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="caregiver">Caregiver</label>
                <select 
                  id="caregiver" 
                  name="caregiverId" 
                  value={newVisit.caregiverId} 
                  onChange={handleCaregiverSelect}
                  required
                >
                  <option value="">Select Caregiver</option>
                  {caregivers.map(cg => (
                    <option key={cg.id} value={cg.id}>{cg.name} ({cg.role})</option>
                  ))}
                </select>
              </div>

              <div className="form-group">
                <label htmlFor="type">Visit Type</label>
                <select 
                  id="type" 
                  name="type" 
                  value={newVisit.type} 
                  onChange={handleInputChange}
                >
                  <option>Regular Visit</option>
                  <option>Doctor Appointment</option>
                  <option>Therapy Session</option>
                  <option>Social Visit</option>
                  <option>Other</option>
                </select>
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label htmlFor="date">Date</label>
                <input 
                  type="date" 
                  id="date" 
                  name="date" 
                  value={newVisit.date} 
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="time">Time</label>
                <input 
                  type="time" 
                  id="time" 
                  name="time" 
                  value={newVisit.time} 
                  onChange={handleInputChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="duration">Duration (minutes)</label>
                <input 
                  type="number" 
                  id="duration" 
                  name="duration" 
                  min="15" 
                  step="15" 
                  value={newVisit.duration} 
                  onChange={handleInputChange}
                />
              </div>
            </div>

            <div className="form-group">
              <label htmlFor="notes">Notes</label>
              <textarea 
                id="notes" 
                name="notes" 
                value={newVisit.notes} 
                onChange={handleInputChange}
                rows="3"
              ></textarea>
            </div>

